"count_invalid\";i:0;}}','auto'),(230,'_site_transient_wp_plugin_dependencies_plugin_data','a:1:{s:8:\"backuply\";a:35:{s:4:\"name\";s:51:\"Backuply &#8211; Backup, Restore, Migrate and Clone\";s:4:\"slug\";s:8:\"backuply\";s:7:\"version\";s:5:\"1.4.0\";s:6:\"author\";s:46:\"<a href=\"https://backuply.com\">Softaculous</a>\";s:14:\"author_profile\";s:43:\"https://profiles.wordpress.org/softaculous/\";s:12:\"contributors\";a:2:{s:11:\"softaculous\";a:3:{s:7:\"profile\";s:43:\"https://profiles.wordpress.org/softaculous/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/32b68618483ab2ab379ec01adbc35963?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:11:\"softaculous\";}s:8:\"backuply\";a:3:{s:7:\"profile\";s:40:\"https://profiles.wordpress.org/backuply/\";s:6:\"avatar\";s:88:\"https://secure.gravatar.com/avatar/1a64c867192feed72a6220febf261df6?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:8:\"Backuply\";}}s:8:\"requires\";s:3:\"4.7\";s:6:\"tested\";s:3:\"6.7\";s:12:\"requires_php\";s:3:\"5.5\";s:16:\"requires_plugins\";a:0:{}s:6:\"rating\";i:92;s:7:\"ratings\";a:5:{i:5;i:88;i:4;i:0;i:3;i:0;i:2;i:2;i:1;i:7;}s:11:\"num_ratings\";i:97;s:11:\"support_url\";s:46:\"https://wordpress.org/support/plugin/backuply/\";s:15:\"support_threads\";i:2;s:24:\"support_threads_resolved\";i:1;s:15:\"active_installs\";i:300000;s:12:\"last_updated\";s:22:\"2024-11-19 12:44pm GMT\";s:5:\"added\";s:10:\"2022-07-22\";s:8:\"homepage\";s:38:\"http://wordpress.org/plugins/backuply/\";s:8:\"sections\";a:5:{s:11:\"description\";s:5542:\"<p>Backuply is a WordPress backup plugin that helps you backup your WordPress website, saving you from loss of data because of server crashes, hacks, dodgy updates, or bad plugins.</p>\n<p>Backuply comes with Local Backups and Secure Cloud backups with easy integrations with FTP, FTPS, SFTP, WebDAV, Google Drive, Microsoft OneDrive, Dropbox, Amazon S3 and easy One-click restoration.</p>\n<p>Your website is your asset and it needs to constantly be protected from various security issues, server issues, hacking, etc. While you take all precautionary steps to protect your website, backups are the best form of security. With Backuply, you can be confident that your data is protected and is always available for restore during any disaster. Backuply creates full backups of your website and you can restore it to the same or a new WordPress website with the click of a button.</p>\n<p>Our backup and website cloning technology have been in use for more than a decade and we have now ported it to WordPress.</p>\n<p>You can find our official documentation at <a href=\"https://backuply.com/docs\" rel=\"nofollow ugc\">https://backuply.com/docs</a>. We are also active in our community support forums on wordpress.org if you are one of our free users. Our Premium Support Ticket System is at <a href=\"https://softaculous.deskuss.com/open.php?topicId=17\" rel=\"nofollow ugc\">https://softaculous.deskuss.com/open.php?topicId=17</a></p>\n<p><a href=\"https://backuply.com\" title=\"Backuply Homepage\" rel=\"nofollow ugc\">Home Page</a> | <a href=\"https://softaculous.deskuss.com/open.php?topicId=17\" title=\"Backuply Support\" rel=\"nofollow ugc\">Support</a> | <a href=\"http://backuply.com/docs\" title=\"Documents\" rel=\"nofollow ugc\">Documents</a></p>\n<h3>Features</h3>\n<ul>\n<li><strong>Local Backups:</strong> Backup your complete website locally on your server with just one click.</li>\n<li><strong>FTP:</strong> Easily backup and restore your backup using FTP.</li>\n<li><strong>Backup to Google Drive</strong></li>\n<li><strong>One-Click Restore:</strong> Restore your website files and databases with a one-click restore.</li>\n<li><strong>Migration:</strong> Stress-free migration to any domain or host.</li>\n<li><strong>Database Backups:</strong> Backup your website&#8217;s database only.</li>\n</ul>\n<h3>Premium Features</h3>\n<ul>\n<li><strong>Automatic Backups:</strong> Choose to back up your website at regular intervals like Daily, Weekly, or Monthly. You can also customize the interval.</li>\n<li><strong>One-click Restore:</strong> With Backuply, restoring your website is simple. Just click on the restore button next to the backup you want to restore from. Your entire backup will be downloaded and the changes will be applied to the website.</li>\n<li><strong>Selective Backup:</strong> You have the option to choose from whether only files or database backups or full backups should be performed.</li>\n<li><strong>Website Migration:</strong> You can easily migrate your website by restoring from one of the Cloud Backup options on the new website.</li>\n<li><strong>Website Cloning:</strong> If you would like to clone your website for any purpose, Backuply can do that for you. Backuply will restore the data but replace the URLs and information as per the existing website. In this way, you can create multiple clones.</li>\n<li><strong>Backup to FTPS:</strong> You can back up your site to an FTPS i.e. FTP over SSL / TLS.</li>\n<li><strong>Backup to SFTP:</strong> Supports the SFTP protocol.</li>\n<li><strong>Backup to Dropbox</strong></li>\n<li><strong>Backup to Microsoft One Drive</strong></li>\n<li><strong>Backup to Amazon S3</strong></li>\n<li><strong>Backup to WebDAV</strong></li>\n<li><strong>Backup to S3 Compatible Storages:</strong> Added support for DigitalOcean Spaces, Linode Object Storage, Vultr Object Storage, and Cloudflare R2.</li>\n<li><strong>Support for WP-CLI:</strong> You can use Backuply through WP-CLI</li>\n<li><strong>Professional Support:</strong> Get professional support and more features to make backup your website with <a href=\"https://backuply.com/pricing\" rel=\"nofollow ugc\">Backuply</a></li>\n</ul>\n<h3>Backups</h3>\n<p>Backup is a way of copying your data or files to a secure place, which can be used to restore your website in case of data loss. Backups are vital in securing the data that you have published or written. Backups with Backuply are easy and secure with support for multiple options of storage like local storage using FTP or using third-party services like Google Drive, Dropbox, Microsoft OneDrive, AWS S3 and WebDAV.<br />\nTo make it even easier we support Automatic Backups with a customizable backup schedule.</p>\n<h3>Restores</h3>\n<p>Restoring is just a One-Click process using Backuply. If the selected backup is available then Backuply will restore your backups safely. Restoring a backup will roll back your site in the exact same state as it was when the backup was created.</p>\n<h3>Migration</h3>\n<p>Backuply creates a tar file of your whole WordPress install with the Database, so you can migrate your site to any host or location where WordPress can be installed. All you need to do is create a Backup of your WordPress install on a remote location, and that&#8217;s it, It can be synced on any WordPress install with ease so you just need to restore the synced backup on the new location for Migration to happen.</p>\n<h3>How to install Backuply</h3>\n<p>Go To your WordPress install -&gt; Plugins -&gt; Add New Button -&gt; In Search Box search For Backuply -&gt; Click on Install.</p>\n\";s:3:\"faq\";s:334:\"<p>Do you have questions related to Backuply? Use the following links :</p>\n<ol>\n<li><a href=\"https://backuply.com/docs\" rel=\"nofollow ugc\">Docs</a></li>\n<li><a href=\"https://backuply.deskuss.com\" rel=\"nofollow ugc\">Help Desk</a></li>\n<li><a href=\"https://wordpress.org/support/plugin/backuply\" rel=\"ugc\">Support Forum</a></li>\n</ol>\n\";s:9:\"changelog\";s:14521:\"<h4>1.4.0 (November 19th 2024)</h4>\n<ul>\n<li>[Task] Made some internal code changes.</li>\n</ul>\n<h4>1.3.9 (November 18th 2024)</h4>\n<ul>\n<li>[Task] Improved some internal codes and tested the same.</li>\n</ul>\n<h4>1.3.8 (November 4th 2024)</h4>\n<ul>\n<li>[Task] Tested with WordPress 6.7</li>\n<li>[Bug-Fix] Settings page was getting killed when some data was not integer.</li>\n<li>[Bug-Fix] functions.php was loading later than few of the registered hooks, which was causing issue to some users this has been fixed.</li>\n</ul>\n<h4>1.3.7 (October 21th 2024)</h4>\n<ul>\n<li>[Improvement] Added retries in Backuply cloud upload.</li>\n</ul>\n<h4>1.3.6 (September 24th 2024)</h4>\n<ul>\n<li>[Improvement] Error reporting has been improved.</li>\n<li>[Task] Improved license handling.</li>\n</ul>\n<h4>1.3.5 (September 13th 2024)</h4>\n<ul>\n<li>[Security-Fix] A security issue reported by bart[WordFence], has been fixed.</li>\n<li>[Improvement] Serialization fix has been improved, its now atleast 100 times faster now.</li>\n</ul>\n<h4>1.3.4 (September 6th 2024)</h4>\n<ul>\n<li>[Improvement] Restores are now faster.</li>\n<li>[Bug-Fix] There was an issue with serialization fix, that has been fixed.</li>\n<li>[Bug-Fix] On some servers backup request was getting blocked as WordPress&#8217;s default User Agent add url too in it which some servers and firewalls sees to be suspicious, this has been fixed.</li>\n</ul>\n<h4>1.3.3 (July 27th 2024)</h4>\n<ul>\n<li>[Improvement] Restore timeouts have been improved to handle restores easily on the slow servers.</li>\n<li>[Improvement] Downloads of local backpup will be handled directly by the browser now.</li>\n<li>[Task] Tested with WordPress 6.6.</li>\n<li>[Bug-Fix] There was an issue adding Backuply Cloud, if the user has reached quota limit, that has been fixed.</li>\n</ul>\n<h4>1.3.2 (June 19th 2024)</h4>\n<ul>\n<li>[Improvement] Restores work better now, will go in maintenance mode when restoring database to prevent noise from WordPress or plugin functionalities, which could break the restore sometimes.</li>\n<li>[Improvement] We have refactored Google Drive lib and it will improve the speed of download when restoring by around 10%.</li>\n<li>[Improvement] Backups will sync just after they are uploaded, using Backuply&#8217;s upload module.</li>\n<li>[Bug-Fix] PHP warnings on backup_ins.php has been fixed.</li>\n<li>[Bug-Fix] PHP warnings when deletion of backups has been fixed.</li>\n</ul>\n<h4>1.3.1 (May 09th 2024)</h4>\n<ul>\n<li>[Bug-Fix] There was a issue with restore for some user, where Backuply was unable to unzip, that has been fixed.</li>\n<li>[Bug-Fix] There was an issue with migration in case when the wp-config.php file was not writable, that has been fixed.</li>\n<li>[Bug-Fix] sanitize_file_name function was adding a _ in the file names which was preventing downloads for some domains, which has been fixed.</li>\n<li>[Bug-Fix] Some PHP warnings has been fixed.</li>\n</ul>\n<h4>1.3.0 (April 16th 2024)</h4>\n<ul>\n<li>[Bug-Fix] There was issue downloading Backups for some users that has been fixed.</li>\n<li>[Bug-Fix] There was an issue connecting to Database when the database was being served over a socket, that has been fixed.</li>\n<li>[Bug-Fix] There was issue in using Custom Cron for Bcloud users that has been fixed.</li>\n<li>[Bug-Fix] For some of the OneDrive users there was a error when trying to add the Backup location, that has been fixed.</li>\n</ul>\n<h4>1.2.9 (March 26th 2024)</h4>\n<ul>\n<li>[Bug-Fix] There was an issue with download for some user because of their WordPress not supporting tar or gz mime types, this has been fixed.</li>\n<li>[Bug-Fix] There was an issue when syncing a backup uploaded manually which originally belonged to backup location other than Local Folder, would not show in the Backup History, that has been fixed.</li>\n<li>[Task] Tested with WordPress 6.5.</li>\n</ul>\n<h4>1.2.8 (March 13 2024)</h4>\n<ul>\n<li>[Improvement] We have made improvements to make Backup Downloads better.</li>\n</ul>\n<h4>1.2.7 (February 16 2024)</h4>\n<ul>\n<li>[Bug-Fix] Version 1.2.5 got included in the plugin package, this release is to fix that.</li>\n</ul>\n<h4>1.2.6 (February  08 2024)</h4>\n<ul>\n<li>[Security-Fix] In some cases it was possible to fill up the logs and has been fixed. Reported by Villu Orav (WordFence)</li>\n<li>[Bug-Fix] There was issue while restoring which has been fixed.</li>\n<li>[Bug-Fix] There was an issue uploading backup file, in which in the name of uploaded backup a _(underscore) was getting added due to a WordPress sanitization function which have been fixed.</li>\n</ul>\n<h4>1.2.5 (February 01 2024)</h4>\n<ul>\n<li>[Bug-Fix] There was an issue uploading backup on Safari Browser that has been fixed.</li>\n</ul>\n<h4>1.2.4 (January 25 2024)</h4>\n<ul>\n<li>[Feature] Option to upload backup files to the user server, directly form the plugin.</li>\n<li>[Improvement] A suggestion made by Bence Szalai to add limit on admin access on Exclude list folder.</li>\n<li>[Improvement] Made the settings of Custom Auto Backups simpler.</li>\n<li>[Bug-Fix] There was an issue with deletion in Backup rotation which has been fixed.</li>\n</ul>\n<h4>1.2.3 (January 18 2024)</h4>\n<ul>\n<li>[Feature] Option to add notes to every manual backups.</li>\n<li>[Bug-Fix] The /backuply/backups folder was getting filled with tmp files or the backup files in case of faliure, which has been fixed, by adding a daily Cron to clean it.</li>\n<li>[Bug-Fix] Backuply Cloud storage was not getting updated on deletion or Creation of backups, it has been fixed.</li>\n<li>[Bug-Fix] cPgaurd was blocking restores, this has been fixed.</li>\n<li>[Bug-Fix] There was an issue while auto backup where security check was failing which has been fixed.</li>\n<li>[Tweak] Backup Rotation was happening before creation of Backup, which is risky, this has been changed to delete after successful backup.</li>\n</ul>\n<h4>1.2.2 (December 15 2023)</h4>\n<ul>\n<li>[Security-fix] There was a privilege check failure which has been fixed.</li>\n</ul>\n<h4>1.2.1 (December 07 2023)</h4>\n<ul>\n<li>[Structural Change] We have made some structural changes, now Backuply Free will be required for the Pro version to work.</li>\n<li>[Improvement] Now you can check quota of backup locations like OneDrive, Dropbox, and Google Drive.</li>\n<li>[Bug-Fix] There was issue with updation of Backuply Cloud quota which has been fixed.</li>\n<li>[Bug-Fix] There was issue while restoring using SFTP and FTPS which has been fixed.</li>\n<li>[Bug-Fix] There were some warnings on the settings page which has been fixed.</li>\n<li>[Bug-Fix] There was an issue related to deletion of Backuply Cloud backups when storage limt reached, which has been fixed.</li>\n</ul>\n<h4>1.2.0 (November 06 2023)</h4>\n<ul>\n<li>[Improvement] While restoring the permission of the root folder wont be updated.</li>\n<li>[Improvement] Logs have been improved to, while restoring all fatal error will be logged in Backuply logs.</li>\n<li>[Bug-Fix] There was a conflict with a few SMTP plugins, which has been fixed.</li>\n<li>[Bug-Fix] There was issue unsetting Email notification field which has been fixed.</li>\n<li>[Bug-Fix] On some servers the restore was failing as it was not able to create files, that has been fixed.</li>\n<li>[Task] Tested with WordPress 6.4.</li>\n</ul>\n<h4>1.1.9 (October 05 2023)</h4>\n<ul>\n<li>[Tweak] Now the timezone of the Backup will be the timezone of the WordPress.</li>\n<li>[Tweak] Memory limit fatal error will be logged in Backuply backup progress.</li>\n<li>[Bug-Fix] There was a function incompatibility issue when creating Backup to FTP.</li>\n<li>[Bug-Fix] There was a issue in FTPS when uploading the file, which has been fixed.</li>\n<li>[Bug-Fix] There was an issue with migration of website when migrating from  / to /example, which has been fixed.</li>\n</ul>\n<h4>1.1.8 (August 24 2023)</h4>\n<ul>\n<li>[Bug-Fix] There was issue while restoring, some users were getting error of unable to unzip, that has been fixed.</li>\n<li>[Tweak] Nag timings where updated.</li>\n<li>[Tweak] Database backups created after version 1.1.7 will delete old tables progressively while restoring, instead of deleting them all at once. This is to reduce the chance of breaking the site if something goes wrong during the restore process..</li>\n</ul>\n<h4>1.1.7 (July, 25 2023)</h4>\n<ul>\n<li>[Feature] Option to download Backuply Cloud backups.</li>\n<li>[Bug-Fix] There was an issue for some users while restoring, with a fatal error of duplicate entry in database restore, which has been fixed.</li>\n<li>[Tweak] The chunk size of Google Drive while restore has been increased to improve the speed of download.</li>\n</ul>\n<h4>1.1.6 (July, 05 2023)</h4>\n<ul>\n<li>[Bug-Fix] There was an issue while restoring of backup not able to unzip that has been fixed.</li>\n<li>[Bug-Fix] There was an issue while downloading backup through Backuply while restoring, that has been fixed.</li>\n</ul>\n<h4>1.1.5 (June, 29 2023)</h4>\n<ul>\n<li>[Bug-Fix] There was issue with Auto Backups for Trial users that has been fixed.</li>\n<li>[Bug-Fix] There was an issue while connecting to Backuply through the trial promo.</li>\n</ul>\n<h4>1.1.4 (June, 24 2023)</h4>\n<ul>\n<li>[Feature] Backuply Cloud now provides 10GB of default space which was set as 1 GB previously.</li>\n<li>[Bug-Fix] The quota of Backuply Cloud was not showing properly.</li>\n<li>[Bug-Fix] On restore a info file was not getting delete after completion of restore that has been fixed.</li>\n</ul>\n<h4>1.1.3 (June, 13 2023)</h4>\n<ul>\n<li>[Feature] Now use Backuply Cloud as your Backup location to keep your website safe.</li>\n<li>[Bug-Fix] There was an issue with Gdrive, backup was getting stuck.</li>\n<li>[Bug-Fix] A user faced a fatal error while listing backups that has been fixed.</li>\n</ul>\n<h4>1.1.2 (April, 3 2023)</h4>\n<ul>\n<li>[Bug-Fix] For some user backup was completing but not creating backup of all directories when backup of Database and Directories was selected that has been fixed.</li>\n<li>[Bug-Fix] Backup was failing at 100% when creating backup to Google Drive that has been fixed.</li>\n<li>[Bug-Fix] There was an issue while deleting local backups thats has been fixed.</li>\n</ul>\n<h4>1.1.1 (March, 31 2023)</h4>\n<ul>\n<li>[Bug-Fix] There was an issue with Backup and restore on sites with broken SSL that has been fixed.</li>\n<li>[Task] Tested with WordPress 6.2.</li>\n</ul>\n<h4>1.1.0 (February, 13 2023)</h4>\n<ul>\n<li>[Feature] Added Support for Wasabi S3 Compatible Object Storage.</li>\n<li>[Feature] Local backups created in Backuply version 1.1.0 and above can be synced.</li>\n<li>[Tweak] To initiate backup we were dependent on WP CRON, which was causing issue for some of our users, as WP Cron was getting stuck. So now manual backup dosen&#8217;t uses WP CRON, WP CRON in backuply is only used by Automatic Backups.</li>\n</ul>\n<h4>1.0.9 (December, 24 2022)</h4>\n<ul>\n<li>[Security-Improvement] Removed all app keys.</li>\n<li>[Security-Improvement] Made restore logs even more secure with more randomness</li>\n</ul>\n<h4>1.0.8 (December, 22 2022)</h4>\n<ul>\n<li>[Security-Fix] Added index.html file and web.config to improve the protection of the backup folder.</li>\n<li>[Security-Fix] Made the backup folder have random strings to make the name be unpredictible.</li>\n<li>[Bug-Fix] There was an issue while creating database backup for some users that has been fixed.</li>\n<li>[Bug-Fix] There was issue loading last logs for some uses, that has been fixed.</li>\n<li>[Bug-Fix] For some user while downloading the Local Backup the progress bar was not updating that has been fixed.</li>\n<li>[Removed] Installing Backuply Pro from the Free version as per the WordPress guidelines.</li>\n</ul>\n<h4>1.0.7 (December, 19 2022)</h4>\n<ul>\n<li>[Security-Fix] The Google Drive App Secret key of Backuply was committed in the code. This is fixed. We have issued a new secret as well !</li>\n</ul>\n<h4>1.0.6 (December, 12 2022)</h4>\n<ul>\n<li>[Bug-Fix] There was an issue while saving the additional file in settings page that has been fixed.</li>\n<li>[Bug-Fix] Issues related to PHP 8.1 and 8.0 compatibility have been fixed.</li>\n<li>[Bug-Fix] There was an issue while creating backuply config for some users that has been fixed.</li>\n<li>[Bug-Fix] When selecting check all files in Additional file option, all databases were getting selected to in exclude database, that has been fixed.</li>\n<li>[Bug-Fix] When selecting auto backup time the auto backup options weren&#8217;t visible for some users that has been fixed.</li>\n<li>[Bug-Fix] For some users the backup was getting stuck at 17% sometimes that has been fixed.</li>\n</ul>\n<h4>1.0.5 (November 15, 2022)</h4>\n<ul>\n<li>[Feature] Added support for WP-CLI, you can perform backup, restore, and sync right from your terminal.</li>\n<li>[Task] We have improved the promotion nags, so it doesn&#8217;t cause inconvenience to our users.</li>\n<li>[Bug-Fix] There was a PHP warning being shown while syncing or downloading from Dropbox that has been fixed.</li>\n<li>[Bug-Fix] There was an issue while deleting GDrive backups that has been fixed.</li>\n</ul>\n<h4>1.0.4 (October 14, 2022)</h4>\n<ul>\n<li>[Feature] Added support for S3 Compatible backup locations like DigitalOcean Spaces, Linode Object Storage, Vultr Object Storage, and Cloudflare R2.</li>\n<li>[Feature] Added support for Server Side Encryption for AWS.</li>\n<li>[Task] Google Drive is now available for all users.</li>\n<li>[Bug-Fix] Part Number while downloading for restore in AWS had an issue. That has been fixed.</li>\n<li>[Bug-Fix] For some user restore was getting stuck at repairing database status, that has been fixed.</li>\n</ul>\n<h4>1.0.3 (September 20, 2022)</h4>\n<ul>\n<li>[Improvement] Added Backup Download progress</li>\n<li>[Task] The Backuply nag will now appear after 7 days instead of 1 day.</li>\n<li>[Bug-Fix] The last backup time was shown from 1970 when no backup was created. This has been fixed.</li>\n<li>[Bug-Fix] Backup on Google was failing for some users. This has been fixed.</li>\n<li>[Bug-Fix] On failure, in some cases the partial backup file was not cleaned. This has been fixed.</li>\n<li>[Bug-Fix] At times, the backup nag was not getting dismissed. This has been fixed.</li>\n</ul>\n<h4>1.0.2 (August 18, 2022)</h4>\n<ul>\n<li>Exclude Files, Directories or Database tables from a backup</li>\n<li>Logs for every backup</li>\n<li>Minor bug fixes</li>\n</ul>\n<h4>1.0.1 (July 22, 2022)</h4>\n<ul>\n<li>Added Last Logs of Backups and Restore</li>\n</ul>\n<h4>1.0.0 (July 21, 2022)</h4>\n<ul>\n<li>Released Plugin</li>\n</ul>\n\";s:11:\"screenshots\";s:2327:\"<ol><li><a href=\"https://ps.w.org/backuply/assets/screenshot-1.png?rev=2760139\"><img src=\"https://ps.w.org/backuply/assets/screenshot-1.png?rev=2760139\" alt=\"&lt;strong&gt;Dashboard&lt;/strong&gt; manual backup and info.\"></a><p><strong>Dashboard</strong> manual backup and info.</p></li><li><a href=\"https://ps.w.org/backuply/assets/screenshot-2.png?rev=2760139\"><img src=\"https://ps.w.org/backuply/assets/screenshot-2.png?rev=2760139\" alt=\"&lt;strong&gt;Settings&lt;/strong&gt; set backup settings like backup location, backup options and email to notify.\"></a><p><strong>Settings</strong> set backup settings like backup location, backup options and email to notify.</p></li><li><a href=\"https://ps.w.org/backuply/assets/screenshot-3.png?rev=2760139\"><img src=\"https://ps.w.org/backuply/assets/screenshot-3.png?rev=2760139\" alt=\"&lt;strong&gt;Backup Locations&lt;/strong&gt; add remote locations to backup and restore from.\"></a><p><strong>Backup Locations</strong> add remote locations to backup and restore from.</p></li><li><a href=\"https://ps.w.org/backuply/assets/screenshot-4.png?rev=2760139\"><img src=\"https://ps.w.org/backuply/assets/screenshot-4.png?rev=2760139\" alt=\"&lt;strong&gt;Backup History&lt;/strong&gt; manage all your backups.\"></a><p><strong>Backup History</strong> manage all your backups.</p></li><li><a href=\"https://ps.w.org/backuply/assets/screenshot-5.png?rev=2761227\"><img src=\"https://ps.w.org/backuply/assets/screenshot-5.png?rev=2761227\" alt=\"&lt;strong&gt;Restore Process&lt;/strong&gt; easy to understand restore progress.\"></a><p><strong>Restore Process</strong> easy to understand restore progress.</p></li><li><a href=\"https://ps.w.org/backuply/assets/screenshot-6.png?rev=2760139\"><img src=\"https://ps.w.org/backuply/assets/screenshot-6.png?rev=2760139\" alt=\"&lt;strong&gt;Add Backup Location&lt;/strong&gt; with a fairly simple form to add a backup location.\"></a><p><strong>Add Backup Location</strong> with a fairly simple form to add a backup location.</p></li><li><a href=\"https://ps.w.org/backuply/assets/screenshot-7.png?rev=2760139\"><img src=\"https://ps.w.org/backuply/assets/screenshot-7.png?rev=2760139\" alt=\"&lt;strong&gt;Backup Process&lt;/strong&gt; easy to understand backup progress.\"></a><p><strong>Backup Process</strong> easy to understand backup progress.</p></li></ol>\";s:7:\"reviews\";s:14445:\"<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Waste of time</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 з 5 зірок\" data-title-template=\"%s з 5 зірок\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Від <a href=\"https://profiles.wordpress.org/shauninza/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/acb9672c55de848ab8e4b93c7ed47935?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/acb9672c55de848ab8e4b93c7ed47935?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/shauninza/\" class=\"reviewer-name\">shauninza</a> о <span class=\"review-date\">20 Листопада, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Hardly ever backs up to their cloud even though you buy the paid version.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Then when it tries, you wait an hour and nothing happens?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Support is not great at all, tried to contact them once or twice and now I just don\'t even try anymore, they not helpful at all.<br /><br />So why contact them in the first place?</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Works 100% of the time. WOW WOW WOW</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 з 5 зірок\" data-title-template=\"%s з 5 зірок\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Від <a href=\"https://profiles.wordpress.org/drhonea/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/eaa314cbef3115eaf750f88e1920af76?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/eaa314cbef3115eaf750f88e1920af76?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/drhonea/\" class=\"reviewer-name\">drhonea</a> о <span class=\"review-date\">19 Листопада, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Works 100% of the time. I use it on all of our sites. HIGHLY recommend it to everyone.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Good product</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 з 5 зірок\" data-title-template=\"%s з 5 зірок\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Від <a href=\"https://profiles.wordpress.org/bricelacomette/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/f73f5f8fe77eebcd01e419d9ddcbc67b?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/f73f5f8fe77eebcd01e419d9ddcbc67b?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/bricelacomette/\" class=\"reviewer-name\">bricelacomette</a> о <span class=\"review-date\">8 Жовтня, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I love it free</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">First time review</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 з 5 зірок\" data-title-template=\"%s з 5 зірок\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Від <a href=\"https://profiles.wordpress.org/tbob75/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/3d3a426f8b799651d8b94ae31f50985b?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/3d3a426f8b799651d8b94ae31f50985b?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/tbob75/\" class=\"reviewer-name\">tbob75</a> о <span class=\"review-date\">4 Жовтня, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>It works just fine for now.. gotta wait for the up coming days ;-)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Perfecto</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 з 5 зірок\" data-title-template=\"%s з 5 зірок\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Від <a href=\"https://profiles.wordpress.org/blueskymark/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/e51790c416ada4a09accb746068d55ec?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/e51790c416ada4a09accb746068d55ec?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/blueskymark/\" class=\"reviewer-name\">blueskymark</a> о <span class=\"review-date\">24 Вересня, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Just what I was looking for</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">First Class!</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 з 5 зірок\" data-title-template=\"%s з 5 зірок\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Від <a href=\"https://profiles.wordpress.org/pdliles/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/f440eaf8d0ce29bd5dccc96ccc383c38?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/f440eaf8d0ce29bd5dccc96ccc383c38?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/pdliles/\" class=\"reviewer-name\">pdliles</a> о <span class=\"review-date\">27 Серпня, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>The product and support are truly first-class.  I needed assistance getting renewed, and the support team got me going quickly.  The product works without a hitch, keeping my site safe and backed up!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great plugin that does the job</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 з 5 зірок\" data-title-template=\"%s з 5 зірок\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				Від <a href=\"https://profiles.wordpress.org/tiffanydigitalnz/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/c8d9f330b27e3c1af16bafa1c7dbf3f2?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/c8d9f330b27e3c1af16bafa1c7dbf3f2?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/tiffanydigitalnz/\" class=\"reviewer-name\">tiffanydigitalnz</a> о <span class=\"review-date\">26 Серпня, 2024</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I was looking for a simple solution to backups and found it with this plugin. </p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great plugin</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 з 5 зірок\" data-title-template=\"%s з 5 зірок\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\