 у форматі YYYY-MM-DD.\nЦе поле має занадто ранню дату.\nЦе поле має надто пізню дату.\nБудь ласка, введіть номер.\nЦе поле має занадто замалий номер.\nЦе поле має занадто великий номер.\nНеправильна відповідь на питання перевірки.\nБудь ласка, введіть адресу електронної пошти.\nБудь ласка, введіть URL.\nБудь ласка, введіть номер телефону.','Контактна форма 1','','publish','closed','closed','','%d0%ba%d0%be%d0%bd%d1%82%d0%b0%d0%ba%d1%82%d0%bd%d0%b0-%d1%84%d0%be%d1%80%d0%bc%d0%b0-1','','','2024-11-13 18:21:29','2024-11-13 18:21:29','',0,'https://flexbox.forwork.fun/?post_type=wpcf7_contact_form&#038;p=22',0,'wpcf7_contact_form','',0),(23,1,'2024-11-13 17:09:28','2024-11-13 17:09:28','','Default Theme','','publish','closed','closed','','default-theme','','','2024-11-13 17:09:28','2024-11-13 17:09:28','',0,'https://flexbox.forwork.fun/?p=23',0,'popup_theme','',0),(24,1,'2024-11-13 17:09:28','2024-11-13 17:09:28','','Light Box','','publish','closed','closed','','lightbox','','','2024-11-13 17:09:28','2024-11-13 17:09:28','',0,'https://flexbox.forwork.fun/?p=24',0,'popup_theme','',0),(25,1,'2024-11-13 17:09:28','2024-11-13 17:09:28','','Enterprise Blue','','publish','closed','closed','','enterprise-blue','','','2024-11-13 17:45:12','2024-11-13 17:45:12','',0,'https://flexbox.forwork.fun/?p=25',0,'popup_theme','',0),(26,1,'2024-11-13 17:09:28','2024-11-13 17:09:28','','Hello Box','','publish','closed','closed','','hello-box','','','2024-11-13 17:09:28','2024-11-13 17:09:28','',0,'https://flexbox.forwork.fun/?p=26',0,'popup_theme','',0),(27,1,'2024-11-13 17:09:28','2024-11-13 17:09:28','','Cutting Edge','','publish','closed','closed','','cutting-edge','','','2024-11-13 17:09:28','2024-11-13 17:09:28','',0,'https://flexbox.forwork.fun/?p=27',0,'popup_theme','',0),(28,1,'2024-11-13 17:09:28','2024-11-13 17:09:28','','Framed Border','','publish','closed','closed','','framed-border','','','2024-11-13 17:09:28','2024-11-13 17:09:28','',0,'https://flexbox.forwork.fun/?p=28',0,'p